import logo from './logo.svg';
import weatherLogo from './resources/WeatherIcons/weatherLogo.svg';
import './App.css';
import { Forecaster} from './componenter/forecaster';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={weatherLogo} className="Weather-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
